	/**
	 * Returns the subset of the passed in array which does not contain nulls.
	 * 
	 * @param values
	 *            the values to check
	 * @param allowBlanks
	 *            true if zero length strings are allowed.
	 * @return the subset of <i>values</i> which is not null.
	 */
	public static String[] clearNulls(String[] values, boolean allowBlanks) {
		Vector<String> buffer = new Vector<>();

		for (String value : values) {
			if (value != null) {
				if (allowBlanks || !("".equals(value.trim()))) {
					buffer.add(value);
				}
			}
		}

		return (String[]) buffer.toArray(new String[buffer.size()]);
	}

	/**
	 * Method for masking a string with a masking character.
	 * 
	 * @param pCardNumber
	 *            - The string to mask. Usually a credit card number
	 * @param pMaskCharacter
	 *            - The character to mask the string with
	 * @param pTrailingVisibleLength
	 *            - Number of trailing characters that should be in free form
	 *            (not masked).
	 * @return The masked string
	 */
	public static String maskString(String pCardNumber, char pMaskCharacter,
			int pTrailingVisibleLength) {
		StringBuffer buffer = new StringBuffer();
		int len = pCardNumber.length();

		for (int i = 0; i < len - pTrailingVisibleLength; i++) {
			buffer.append(pMaskCharacter);
		}

		int initial = len - pTrailingVisibleLength;
		if (initial < 0) {
			initial = 0;
		}
		for (int i = initial; i < len; i++) {
			buffer.append(pCardNumber.charAt(i));
		}

		return buffer.toString();
	}

	/**
	 * Converts an array of bytes into a String of hex, two characters per bytes
	 * 
	 * @param pBytes
	 *            An array of byte
	 * @return The hex representation of bytes
	 */
	public static String toHex(byte[] pBytes) {
		if (pBytes == null) {
			return null;
		}

		StringBuffer sb = new StringBuffer();
		int h;

		for (byte pByte : pBytes) {
			h = pByte & 0xFF;
			if (h < 16) {
				sb.append("0");
			}
			sb.append(Integer.toString(h, 16).toUpperCase());
		}
		return sb.toString();
	}

	private static final String HEXINDEX = "0123456789abcdef0123456789ABCDEF";

	public static byte[] hexToByte(String s) {

		int l = s.length() / 2;
		byte data[] = new byte[l];
		int j = 0;

		for (int i = 0; i < l; i++) {
			char c = s.charAt(j++);
			int n, b;
			n = HEXINDEX.indexOf(c);
			if (n == -1)
				return null;
			b = (n & 0xf) << 4;
			c = s.charAt(j++);
			n = HEXINDEX.indexOf(c);
			b += (n & 0xf);
			data[i] = (byte) b;
		}
		return data;
	}

	/**
	 * Pre pads the <code>String</code> <i>s</i> with the <code>char</code>
	 * <i>c</i> until it is <i>l</i> characters long.
	 * 
	 * @param s
	 *            the string to pad
	 * @param c
	 *            the leading character to pad with.
	 * @param l
	 *            the length to pad to.
	 * @return the padded string.
	 */
	public static final String pad(String s, char c, int l) {
		for (int i = s.length(); i < l; i++) {
			s = String.valueOf(c) + s;
		}

		return s;
	}

	/**
	 * Pads the string passed in parameter <i>s</i> to be of total length given
	 * by parameter <i>l</i>. It does this by inserting as many of characters as
	 * necessary to the beginning of the string. The character used for padding
	 * is given by parameter <i>c</i>. If the string is already longer than the
	 * desired length it will be truncated. The final string is then appended to
	 * the StringBuffer given by parameter <i>sb</i>.
	 * 
	 * @param sb
	 *            The StringBuffer to append to
	 * @param s
	 *            The String to pad
	 * @param l
	 *            The length which the resulting String should be
	 * @param c
	 *            The character to use for padding
	 * @return The newly lengthened StringBuffer
	 */
	public static StringBuffer lpad(StringBuffer sb, String s, int l, char c) {
		int i;
		int ln = 0;
		int st = 0;
		if (s != null && !s.equals("")) {
			ln = s.length();
		}

		st = l - ln;
		if (st < 0) {
			st = 0;
		}
		for (i = 0; i < st; i++) {
			sb.append(c);
		}
		for (i = st; i < l; ++i) {
			sb.append(s.charAt(i - st));
		}

		return sb;
	} // end of lpad

	/**
	 * Pads the string passed in parameter <i>s</i> to be of total length given
	 * by parameter <i>l</i>. It does this by inserting as many of characters as
	 * necessary to the end of the string. The character used for padding is
	 * given by parameter <i>c</i>. If the string is already longer than the
	 * desired length it will be truncated. The final string is then appended to
	 * the StringBuffer given by parameter <i>sb</i>.
	 * 
	 * @param sb
	 *            The StringBuffer to append to
	 * @param s
	 *            The String to pad
	 * @param l
	 *            The length which the resulting String should be
	 * @param c
	 *            The character to use for padding
	 * @return The newly lengthened StringBuffer
	 */
	public static StringBuffer rpad(StringBuffer sb, String s, int l, char c) {
		int i;
		int ln = 0;

		if (s != null) {
			ln = s.length();
		}
		if (ln > l) {
			ln = l;
		}
		for (i = 0; i < ln; ++i) {
			sb.append(s.charAt(i));
		}
		for (i = ln; i < l; i++) {
			sb.append(c);
		}

		return sb;
	} // end of rpad

	private static final String DONT_WANTED_INDEX = ",.&#+@?*()=!<>\\|~`";

	/**
	 * Given a string, remove those special characters, and replace space and
	 * "_" with "-"
	 */
	public static String getUrlText(String s) {
		if (StringUtil.isEmpty(s)) {
			return s;
		}

		StringBuffer data = new StringBuffer();
		for (int i = 0; i < s.length(); i++) {
			char c = s.charAt(i);
			int n;
			n = DONT_WANTED_INDEX.indexOf(c);
			if (n >= 0) {
				continue;
			}
			if (c == ' ' || c == '_') {
				c = '-';
			}
			data.append(c);
		}
		return data.toString();

	}

	/**
	 * use this method to return the text that escapes the special character
	 * like "'" and """. This is for oracle only
	 * 
	 * @return
	 */
	public static String getOracleEscapeText(String pText) {
		if (pText == null)
			return null;

		StringBuffer buffer = new StringBuffer();
		for (int i = 0; i < pText.length(); i++) {
			char c = pText.charAt(i);
			if (c == '\'') {
				buffer.append(c).append(c);
			} else {
				buffer.append(c);
			}
		}
		return buffer.toString();
	}

	/**
	 * use this method to return the text that escapes the special character
	 * like "'" and """. This is for MySQL only
	 * 
	 * @return
	 */
	public static String getMySQLEscapeText(String pText) {
		if (pText == null)
			return null;

		StringBuffer buffer = new StringBuffer();
		for (int i = 0; i < pText.length(); i++) {
			char c = pText.charAt(i);
			if (c == '\'') {
				buffer.append('\\').append(c);
			} else {
				buffer.append(c);
			}
		}
		return buffer.toString();
	}

	/**
	 * parse key words
	 * 
	 * @param keyWords
	 * @return List
	 */
	public static List<String> parseKeyWords(String keyWords) {
		String s = keyWords;
		ArrayList<String> words = new ArrayList<>();
		String[] ss = null;
		if (!isEmpty(s)) {
			ss = s.split(" ");

			for (String s1 : ss) {
				if (StringUtil.isEmpty(s1)) {
					continue;
				}
				String temp = null;
				temp = getMySQLEscapeText(s1);
				temp = "%" + temp + "%";
				words.add(temp);
			}
		}
		return words;
	}

	public static String getFileSuffix(String fileName) {
		int length = fileName.length();
		int begin = fileName.lastIndexOf(".");
		if (begin != -1) {
			String suffix = fileName.substring(begin, length).trim();
			return suffix;
		}
		return null;
	}

	public static String escapeCommaForString(String s) {
		String result = "";
		if (StringUtil.isNotEmpty(s)) {
			String[] temp = s.split(",");
			for (String t : temp) {
				result = result + t;
			}
		}

		return result;
	}

	/**
	 * Convert a string array to a string, separated by separator param.
	 * 
	 * @param stringArray
	 *            the string array to be converted to string.
	 * @param separator
	 *            the separator to be used in separating the string elements.
	 * @return a string.
	 */
	public static String arrayToString(String[] stringArray, String separator) {
		if (stringArray == null || stringArray.length < 0) {
			return null;
		}

		String str = "";
		for (int i = 0; i < stringArray.length; i++) {
			str = str + stringArray[i];
			if (i < stringArray.length - 1) {
				str += separator;
			}
		}

		return str;
	}

	public static String cutString(String description, int length) {
		String d = description;
		if (StringUtil.isEmpty(d))
			return null;
		if (d.length() > length) {
			while (d.charAt(length) != ' ')
				length++;
			d = d.substring(0, length) + "...";
		}
		return d;
	}

	/**
	 * get class's simple name excluding the package name
	 * 
	 * @param className
	 * @return
	 */
	public static String getSimpleClassName(Class<?> className) {
		String fullName = className.getName();
		String packageName = className.getPackage().getName();
		String name = fullName.substring(packageName.length() + 1);
		return name;
	}

	/**
	 * convert String to HashMap for example: key1=value1, key2=value2,
	 * key3=value3 parse the string and set the pairs into HashMap
	 * 
	 * @param s
	 * @return
	 */
	public static HashMap<String, String> converStringToMap(String s) {
		HashMap<String, String> map = new HashMap<>();
		if (StringUtil.isNotEmpty(s)) {
			String[] parts = s.split(", |=");
			for (int i = 0; i < parts.length; i += 2) {
				map.put(parts[i], parts[i + 1]);
			}
		}
		return map;
	}

