	/**
	 * get encoded url with parameters
	 * 
	 * @param originUrl
	 * @param params
	 * @return encoded url with all parameters
	 */
	public static String getFullEncodedUrl(String originUrl,
			HashMap<String, String> params) {
		// do nothing if no parameter is needed
		if (null == params || params.isEmpty()) {
			return originUrl;
		}
		// plus parameters to original url
		originUrl += "?";
		Iterator<?> iter = params.entrySet().iterator();
		while (iter.hasNext()) {
			@SuppressWarnings("rawtypes")
			Map.Entry entry = (Map.Entry) iter.next();
			String paramName = entry.getKey().toString();
			String paramValue = null;
			try {
				if (null != entry.getValue()) {
					paramValue = entry.getValue().toString();
					paramValue = URLEncoder.encode(paramValue, "UTF-8");
				}
			} catch (UnsupportedEncodingException e) {
				e.printStackTrace();
			}
			originUrl += paramName + "=" + paramValue + "&";
		}
		// remove the last & character
		originUrl = originUrl.substring(0, originUrl.lastIndexOf("&"));
		originUrl = originUrl.replaceAll("\\+", "%20");// I hate the whitespace
		return originUrl;
	}

