	public static boolean isTel(String tel) {
		if (isEmpty(tel))
			return false;
		Pattern p = Pattern
				.compile("^((13[0-9])|(15[^4,\\D])|(18[0,1-9]))\\d{8}$");
		return p.matcher(tel).matches();
	}

	/**
	 * 密码长度控制6-18位
	 * 
	 * @param pwd
	 * @return
	 */
	public static boolean isPwd(String pwd) {
		if (isEmpty(pwd) || pwd.length() < 6 || pwd.length() > 18)
			return false;
		return true;
	}

	public static String convertUrlToFileName(String url) {
		if (isEmpty(url)) {
			return null;
		}
		String fileName = url.substring(url.lastIndexOf("/") + 1, url.length());
		return fileName;
	}

	/** 生成随机颜色 **/
	public static int getRandomColor() {
		Random random = new Random();
		int r = random.nextInt(256);
		int g = random.nextInt(256);
		int b = random.nextInt(256);
		return Color.rgb(r, g, b);
	}

	/**
	 * 判断当前时间是否大于用户选择的时间，如果大于返回false
	 * 
	 * @param time
	 * @return
	 */
	public static boolean judgmentTime(String time) {
		DateFormat df = new SimpleDateFormat(
				"yyyy-MM-dd HH:mm:ss");
		Calendar c1 = Calendar.getInstance();
		Calendar c2 = Calendar.getInstance();
		try {
			c1.setTime(new Date());// 当前时间
			c2.setTime(df.parse(time + " 23:59:59"));// 结束时间
		} catch (ParseException e) {
			System.err.println("格式不正确");
		}
		int result = c1.compareTo(c2);
		if (result <= 0)// 当前时间小于等于用户选择的时间
			return true;
		else
			// "c1大于c2" 当前时间大于用户选择的时间
			return false;
	}

	/**
	 * conversion Date to String 'yyyy-MM-dd'
	 */
	public static String dateToStringFormat(Date date, String format) {
		if (date != null) {
			SimpleDateFormat sdf = new SimpleDateFormat(format);
			return sdf.format(date);
		}
		return null;
	}

	/**
	 * 判定输入汉字
	 * 
	 * @param c
	 * @return
	 */
	public static boolean isChinese(char c) {
		Character.UnicodeBlock ub = Character.UnicodeBlock.of(c);
		if (ub == Character.UnicodeBlock.CJK_UNIFIED_IDEOGRAPHS
				|| ub == Character.UnicodeBlock.CJK_COMPATIBILITY_IDEOGRAPHS
				|| ub == Character.UnicodeBlock.CJK_UNIFIED_IDEOGRAPHS_EXTENSION_A
				|| ub == Character.UnicodeBlock.GENERAL_PUNCTUATION
				|| ub == Character.UnicodeBlock.CJK_SYMBOLS_AND_PUNCTUATION
				|| ub == Character.UnicodeBlock.HALFWIDTH_AND_FULLWIDTH_FORMS) {
			return true;
		}
		return false;
	}

	/**
	 * 检测String含有中文
	 * 
	 * @param name
	 * @return true-有中文 false - 无中文
	 */
	public static boolean checkNameChese(String name) {
		boolean res = false;
		char[] cTemp = name.toCharArray();
		for (int i = 0; i < name.length(); i++) {
			if (isChinese(cTemp[i])) {
				res = true;
				break;
			}
		}
		return res;
	}

	/**
	 * 米换算成千米
	 * 
	 * @param level
	 * @return
	 */
	public static String coventLevel(String level) {
		String jl = "0m";

		if (null == level || "".equals(level))
			return jl;

		Double l = Double.parseDouble(level);

		if (l > 1000) {
			jl = (l / 1000) + "";
			return jl.substring(0, jl.indexOf(".") + 2) + "km";
		} else {
			return level + "m";
		}

	}

	public static String getString(String str) {
		if (null == str || "".equals(str.trim()) || "null".equals(str.trim())) {
			return "";
		} else {
			return str;
		}
	}

