	public static String getLongComing(String end, String start) {

		if (isEmpty(end)) {
			return "";
		}

		if (isEmpty(start)) {
			return "";
		}

		long endLong = Long.parseLong(end) - 8 * 3600;
		long startLong = Long.parseLong(start) - 8 * 3600;

		Date dt = new Date();
		long now = dt.getTime();// 当前时间的毫秒数

		if (startLong * 1000 > now) {
			return "活动将于  "
					+ timestamp2Date(startLong + 30 * 60 + "", "MM月dd日 HH点")
					+ "开始，敬请期待！";
		}
		endLong = endLong * 1000;
		startLong = startLong * 1000;

		if (startLong < now & now < endLong) {
			startLong = now;
		}

		if (now > endLong) {
			return "活动已结束";
		}

		long nd = 1000 * 24 * 60 * 60;// 一天的毫秒数
		long nh = 1000 * 60 * 60;// 一小时的毫秒数
		long nm = 1000 * 60;// 一分钟的毫秒数
		long ns = 1000;// 一秒钟的毫秒数

		long day = 0;
		long hour = 0;
		long min = 0;
		long sec = 0;

		long diff = endLong - startLong + 29 * 60;

		day = diff / nd;// 计算差多少天
		hour = diff % nd / nh + day * 24;// 计算差多少小时
		min = diff % nd % nh / nm + day * 24 * 60;// 计算差多少分钟
		sec = diff % nd % nh % nm / ns;// 计算差多少秒

		String time2 = "<strong>" + day + "天" + "</strong>" + "<strong>"
				+ (hour - day * 24) + "</strong>" + "时后结束";

		// String time = day + "天" + (hour - day * 24) + "时后结束";

		return time2;
	}

	public static String getLong(String end, String start) {

		if (isEmpty(end)) {
			return "";
		}

		if (isEmpty(start)) {
			return "";
		}

		long endLong = Long.parseLong(end) - 8 * 3600;
		long startLong = Long.parseLong(start) - 8 * 3600;

		Date dt = new Date();
		long now = dt.getTime();// 当前时间的毫秒数

		if (startLong * 1000 > now) {
			return "活动将于  "
					+ timestamp2Date(startLong + 30 * 60 + "", "MM月dd日 HH点")
					+ "开始，敬请期待！";
		}
		endLong = endLong * 1000;
		startLong = startLong * 1000;

		if (startLong < now & now < endLong) {
			startLong = now;
		}

		if (now > endLong) {
			return "活动已结束";
		}

		long nd = 1000 * 24 * 60 * 60;// 一天的毫秒数
		long nh = 1000 * 60 * 60;// 一小时的毫秒数
		long nm = 1000 * 60;// 一分钟的毫秒数
		long ns = 1000;// 一秒钟的毫秒数

		long day = 0;
		long hour = 0;
		long min = 0;
		long sec = 0;

		long diff = endLong - startLong;

		day = diff / nd;// 计算差多少天
		hour = diff % nd / nh + day * 24;// 计算差多少小时
		min = diff % nd % nh / nm + day * 24 * 60;// 计算差多少分钟
		sec = diff % nd % nh % nm / ns;// 计算差多少秒

		String time = day + "天" + (hour - day * 24) + "时"
				+ (min - day * 24 * 60) + "分后结束";
		if (day < 1) {
			time = (hour - day * 24) + "时" + (min - day * 24 * 60) + "分后结束";
		}

		return time;
	}

	// 时间差
	public static long getLongBad(long end, long start) {

		long endLong = end - 8 * 3600;
		long startLong = start - 8 * 3600;

		Date dt = new Date();
		long now = dt.getTime();// 当前时间的毫秒数

		endLong = endLong * 1000;
		startLong = startLong * 1000;

		if (now > endLong) {
			return 0l;
		} else {
			return -1l;
		}

	}

	/**
	 * 将String型的time值转换为日期（年/月/日 时:分）
	 * 
	 * @param time
	 *            秒数字符串
	 * @param format
	 *            如："yyyy-MM-dd HH:mm"
	 * @return dateStr 日期字符串,传参为空时,返回""
	 * 
	 */
	public static String timestamp2Date(String time, String format) {
		String dateStr = null;
		Date date = null;
		try {
			if (time != null) {
				date = new Timestamp(Long.parseLong(time) * 1000);
			} else {
				return "";
			}

			DateFormat dateformat = new SimpleDateFormat(format);
			dateStr = dateformat.format(date);
		} catch (Exception e) {
			e.printStackTrace();
		}
		return dateStr;
	}

	/**
	 * 保留小数点后两位
	 * 
	 * @param num
	 */
	public static String stayNumber(String num) {
		if (StringUtil.isNotEmpty(num)) {
			double deci = 0;
			DecimalFormat df = null;
			try {
				deci = Double.parseDouble(num);
				df = new DecimalFormat("#0.00");
			} catch (Exception e) {
				// TODO: handle exception
			}
			return df.format(deci);
		}
		return "";

	}

	/**
	 * 整数
	 * 
	 * @param num
	 * @return
	 */
	public static String stayInteger(String num) {
		double deci = 0;
		DecimalFormat df = null;
		try {
			deci = Double.parseDouble(num);
			df = new DecimalFormat("#");
		} catch (Exception e) {
			// TODO: handle exception
		}
		return df.format(deci);
	}

	public static String getDate(String time) {
		Date d = new Date(time);
		SimpleDateFormat sdf = new SimpleDateFormat("MM月dd日 HH时mm分");
		return sdf.format(d);
	}

