	/**
	 * 根据手机的分辨率从 dp 的单位 转成为 px(像素)
	 */
	public static int dip2px(Context context, float dpValue) {
		final float scale = context.getResources().getDisplayMetrics().density;
		return (int) (dpValue * scale + 0.5f);
	}

	/**
	 * 根据手机的分辨率从 px(像素) 的单位 转成为 dp
	 */
	public static int px2dip(Context context, float pxValue) {
		final float scale = context.getResources().getDisplayMetrics().density;
		return (int) (pxValue / scale + 0.5f);
	}

	public static Bitmap toBimap(Context context, int v) {
		InputStream is = context.getResources().openRawResource(v);
		BitmapDrawable bmpDraw = new BitmapDrawable(is);
		Bitmap bmp = bmpDraw.getBitmap();
		return bmp;
	}

	public static int getWid(Activity context) {
		DisplayMetrics metric = new DisplayMetrics();
		context.getWindowManager().getDefaultDisplay().getMetrics(metric);
		int width = metric.widthPixels; // 屏幕宽度（像素）
		// float density = metric.density; // 屏幕密度（0.75 / 1.0 / 1.5）
		// int densityDpi = metric.densityDpi; // 屏幕密度DPI（120 / 160 / 240）
		return width;
	}
	
	public static int getHei(Activity context) {
		DisplayMetrics metric = new DisplayMetrics();
		context.getWindowManager().getDefaultDisplay().getMetrics(metric);
		int height = metric.heightPixels; // 屏幕高度（像素）
		// float density = metric.density; // 屏幕密度（0.75 / 1.0 / 1.5）
		// int densityDpi = metric.densityDpi; // 屏幕密度DPI（120 / 160 / 240）
		return height;
	}
	
	/**
	 * 检测sd卡是否可以用
	 * 
	 * @return
	 */
	public static boolean checkSdCard() {
		if (Environment.getExternalStorageState().equals(
				Environment.MEDIA_MOUNTED)) {
			// sd card 可用
			return true;
		} else {
			// 当前不可用
			return false;
		}
	}
	
	
	public void getdate() {
		Calendar calendar = null;
		calendar = new GregorianCalendar();// 子类实例化
		System.out.println("月 " + (calendar.get(Calendar.MONTH) + 1));
		System.out.println("日： " + calendar.get(Calendar.DAY_OF_MONTH));
		System.out.println("时： " + calendar.get(Calendar.HOUR_OF_DAY));
		System.out.println("分： " + calendar.get(Calendar.MINUTE));
		System.out.println("秒： " + calendar.get(Calendar.SECOND));
		System.out.println("毫秒 " + calendar.get(Calendar.MILLISECOND));
	}
	
